Por favor, não publique ou divulgue informações que violem as regras do jogo. Os infratores serão punidos com severidade.
O conteúdo de violação inclui, mas não está limitado a--
1. Informações de privacidade pessoal: como senha da conta, nome real, etc.
2. Informações indutoras: como compras de recarga, downloads de links, etc.
3. Informações sociais: como plataformas sociais, informações de contato, links de sites, etc.
4. Conteúdo que viola as leis e regulamentações nacionais:
 (1) Violar os princípios básicos estabelecidos pela Constituição;
 (2) Colocar em perigo a segurança nacional, vazar segredos de estado, subverter o poder do estado e minar a unidade nacional;
 (3) Danos à honra e aos interesses nacionais;
 (4) Incitar o ódio étnico, discriminação étnica e minar a unidade étnica;
 (5) Destruindo as políticas religiosas do estado e promovendo cultos e superstições feudais;
 (6) Espalhar boatos, perturbar a ordem social e minar a estabilidade social;
 (7) Espalhar obscenidade, pornografia, jogos de azar, violência, terror ou instigar o crime;
 (8) Insultar ou caluniar os outros, infringindo os direitos e interesses legítimos de terceiros;
 (9) Incitar assembléias ilegais, associações, procissões, manifestações, reunir multidões para perturbar a ordem social;
 (10) Atividades em nome de organizações civis ilegais;
 (11) Incumprimento das "Disposições provisórias sobre o desenvolvimento e gestão de serviços de informação pública para ferramentas de mensagens instantâneas" e não cumprimento dos requisitos das "sete regras básicas" das leis e regulamentos, sistema socialista, interesses nacionais, interesses legítimos dos cidadãos, público ordem, ética social e autenticidade da informação;
 (12) Contém outro conteúdo proibido por leis e regulamentos administrativos. 
5. Outro conteúdo que não está em conformidade com as leis, regulamentos e requisitos de plataforma.

#cfa7a0f Sobre a função de gerenciamento de música #n
- Nos jogos online, apenas o host ou servidor tem autoridade para exercer as operações de gerenciamento do reprodutor de música, como pausar, próxima música, excluir música, etc .;

#cfa7a0f Sobre o conteúdo de música que pode ser reproduzido sob demanda #n
- Por enquanto, apenas algumas das músicas autorizadas pelo QQ Music são suportadas. Atualmente, estamos nos esforçando para obter mais permissões de música sob demanda, portanto, fique atento;

#cfa7a0f Sobre as restrições sob demanda no modo online #n
-Música que já está na lista de reprodução não pode ser adicionada repetidamente sob demanda;
-Não-proprietário pode adicionar apenas três músicas à lista de espera ao mesmo tempo. Depois de atingir o limite superior, eles precisam aguardar que as músicas que foram solicitadas terminem ou sejam excluídas pelo proprietário antes de reordená-las;

#cfa7a0f Sobre o modo de reprodução de música #n
- Reprodução em sequência: Toca na ordem da fila de reprodução e a música será removida da fila após ser reproduzida.
-Loop play: reproduz na ordem da fila de reprodução, e a música permanecerá na lista de espera após a reprodução.

#cfa7a0f Sobre a função de reprodução completa #n
- Quando ligado, todos os jogadores do jogo podem adicionar músicas à fila de reprodução.
- Quando fechado, apenas o host ou servidor do jogo pode adicionar músicas à fila de reprodução.

1. Os aventureiros têm a oportunidade de ativar um pacote de presentes surpresa quando concluem várias ações do jogo;
2. Cada pacote de presente de evento acionado só pode ser comprado uma vez, e o pacote de presente desaparece após a compra ser concluída;
3. Cada pacote de presente surpresa tem um cronômetro de contagem regressiva separado. Após a contagem regressiva, o pacote de presente desaparece. Não percam, aventureiros!

O botão à esquerda é selecionado: quando o elemento pai muda, a distância entre o elemento filho e a borda esquerda do elemento pai não muda;
-O botão direito é selecionado: quando o elemento pai muda, a distância entre o elemento filho e a borda direita do elemento pai não muda;
-O botão superior é selecionado: quando o elemento pai muda, a distância entre o elemento filho e a borda superior do elemento pai não muda;
-O botão inferior é selecionado: quando o elemento pai muda, a distância entre o elemento filho e a borda inferior do elemento pai não muda;
-Os botões esquerdo e direito são selecionados ao mesmo tempo: quando o elemento pai muda, a distância horizontal entre o elemento filho e o ponto central do elemento pai não muda;
-Os botões para cima e para baixo são selecionados ao mesmo tempo: quando o elemento pai muda, a distância vertical entre o elemento filho e o ponto central do elemento pai não muda;
